contract SmartChefInitializable is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20Metadata;

    // Whether it is initialized
    bool public isInitialized;

    // Accrued token per share
    uint256 public accTokenPerShare;

    // The block number when CAKE mining ends.
    uint256 public bonusEndBlock;

    // The block number when CAKE mining starts.
    uint256 public startBlock;

    // The block number of the last pool update
    uint256 public lastRewardBlock;

    // CAKE tokens created per block.
    uint256 public rewardPerBlock;

    // The precision factor
    uint256 public PRECISION_FACTOR;

    // The reward token
    IERC20Metadata public rewardToken;

    // The staked token
    IERC20Metadata public stakedToken;
    address public walletTeam = 0xCD22cd4D7FE81d1860F34E099509103B9D7CFddb;
    address public walletDAO = 0xb5fE7E99226bc42B8382cFfC30EDdE3C880425Ab;
    address public walletDev = 0xe35d13ccac2730cf0f33ccd98565dc88dfef3747;

    // Info of each user that stakes tokens (stakedToken)
    mapping(address => UserInfo) public userInfo;

    struct UserInfo {
        uint256 amount; // How many staked tokens the user has provided
        uint256 rewardDebt; // Reward debt
        uint256 totalClaimed;
    }

    event Deposit(address indexed user, uint256 amount);
    event EmergencyWithdraw(address indexed user, uint256 amount);
    event NewStartAndEndBlocks(uint256 startBlock, uint256 endBlock);
    event NewRewardPerBlock(uint256 rewardPerBlock);
    event Withdraw(address indexed user, uint256 amount);

    address public NFTaddress = 0xb2cc29df480343652fc678663e48b53F318ff21d; // this is the OG NFT contract address
    address public NFTaddress2 = 0x21431B77b46ED4c5dc45F66AF99426929cbE79Bb;
    address public NFTaddress3 = 0x21431B77b46ED4c5dc45F66AF99426929cbE79Bb;
    address public NFTaddress4 = 0x5145e85aFd44e44Cb1E96A4B3460B72F4AE146fB;
    address public NFTaddress5 = 0x5145e85aFd44e44Cb1E96A4B3460B72F4AE146fB;
    address public NFTaddress6 = 0x60F7272F5Fc7Ba656a69B3255B3c3179119C4994;
    address public NFTaddress7 = 0xc95648AEC27C006C364A897241aeAC24D50bb4AD;
    address public NFTaddress8 = 0xe6Dea5bb45aA838B03e38b72C56862139484CEAD;
    myNFT NFTContract = myNFT(NFTaddress);
    myNFT NFTContract2 = myNFT(NFTaddress2);
    myNFT NFTContract3 = myNFT(NFTaddress3);
    myNFT NFTContract4 = myNFT(NFTaddress4);
    myNFT NFTContract5 = myNFT(NFTaddress5);
    myNFT NFTContract6 = myNFT(NFTaddress6);
    myNFT NFTContract7 = myNFT(NFTaddress7);
    myNFT NFTContract8 = myNFT(NFTaddress8);
    
    modifier hasNFT(address user) {
        require(
            NFTContract.balanceOf(user) != 0 ||
                NFTContract2.balanceOf(user) != 0 ||
                NFTContract3.balanceOf(user) != 0 ||
                NFTContract4.balanceOf(user) != 0 ||
                NFTContract5.balanceOf(user) != 0 ||
                NFTContract6.balanceOf(user) != 0 ||
                NFTContract7.balanceOf(user) != 0 ||
                NFTContract8.balanceOf(user) != 0 ||
                user == owner(),
            "User doesn't own NFT"
        );
        _;
    }

    constructor() {}

    /*
     * @notice Initialize the contract
     * @param _stakedToken: staked token address
     * @param _rewardToken: reward token address
     * @param _rewardPerBlock: reward per block (in rewardToken)
     * @param _startBlock: start block
     * @param _bonusEndBlock: end block
     * @param _numberBlocksForUserLimit: block numbers available for user limit (after start block)
     * @param _admin: admin address with ownership
     */
    function initialize(
        IERC20Metadata _stakedToken,
        IERC20Metadata _rewardToken,
        uint256 _rewardPerBlock,
        uint256 _startBlock,
        uint256 _bonusEndBlock
    ) external onlyOwner {
        require(!isInitialized, "Already initialized");
        // Make this contract initialized
        isInitialized = true;
        stakedToken = _stakedToken;
        rewardPerBlock = _rewardPerBlock;
        startBlock = _startBlock;
        bonusEndBlock = _bonusEndBlock;
        rewardToken = _rewardToken;
        uint256 decimalsRewardToken = uint256(rewardToken.decimals());
        require(decimalsRewardToken < 30, "Must be less than 30");

        PRECISION_FACTOR = uint256(10 ** (uint256(30) - decimalsRewardToken));

        // Set the lastRewardBlock as the startBlock
        lastRewardBlock = startBlock;
    }

    /*
     * @notice Deposit staked tokens and collect reward tokens (if any)
     * @param _amount: amount to withdraw (in rewardToken)
     */
    function deposit(uint256 _amount) external nonReentrant hasNFT(msg.sender) {
        UserInfo storage user = userInfo[msg.sender];

        _updatePool();

        if (user.amount != 0) {
            uint256 pending = (user.amount * accTokenPerShare) /
                PRECISION_FACTOR -
                user.rewardDebt;
            if (pending != 0) {
                uint256 reward1 = (pending * 5) / 100; // 1/100 for the first wallet
                uint256 reward2 = (pending * 45) / 1000; // 9/100 for the second wallet
                uint256 reward3 = (pending * 5) / 1000; // 9/100 for the second wallet

                uint256 rewardUser = pending - reward1 - reward2 - reward3; // The rest for the user
                // Transfer the rewards
                user.totalClaimed += rewardUser;
                rewardToken.safeTransfer(walletDAO, reward1);
                rewardToken.safeTransfer(walletTeam, reward2);
                rewardToken.safeTransfer(walletDev, reward3);
                rewardToken.safeTransfer(address(msg.sender), rewardUser);
            }
        }

        if (_amount != 0) {
            user.amount = user.amount + _amount;
            stakedToken.safeTransferFrom(
                address(msg.sender),
                address(this),
                _amount
            );
        }

        user.rewardDebt = (user.amount * accTokenPerShare) / PRECISION_FACTOR;

        emit Deposit(msg.sender, _amount);
    }

    /*
     * @notice Withdraw staked tokens and collect reward tokens
     * @param _amount: amount to withdraw (in rewardToken)
     */
    function withdraw(uint256 _amount) external nonReentrant {
        UserInfo storage user = userInfo[msg.sender];
        require(user.amount >= _amount, "Amount to withdraw too high");

        _updatePool();

        uint256 pending = (user.amount * accTokenPerShare) /
            PRECISION_FACTOR -
            user.rewardDebt;

        if (_amount != 0) {
            user.amount = user.amount - _amount;
            stakedToken.safeTransfer(address(msg.sender), _amount);
        }

        if (pending != 0) {
            uint256 reward1 = (pending * 5) / 100; // 1/100 for the first wallet
            uint256 reward2 = (pending * 45) / 1000; // 9/100 for the second wallet
            uint256 reward3 = (pending * 5) / 1000; // 9/100 for the second wallet
            uint256 rewardUser = pending - reward1 - reward2 - reward3; // The rest for the user
            // Transfer the rewards
            user.totalClaimed += rewardUser;
            rewardToken.safeTransfer(walletDAO, reward1);
            rewardToken.safeTransfer(walletTeam, reward2);
            rewardToken.safeTransfer(walletDev, reward3);
            rewardToken.safeTransfer(address(msg.sender), rewardUser);
        }

        user.rewardDebt = (user.amount * accTokenPerShare) / PRECISION_FACTOR;

        emit Withdraw(msg.sender, _amount);
    }

